akBrN0dpOJFvQA==","dtype":"float64","shape":[5]},"y_offset":{"__ndarray__":"zDt/Zp6g5r/MO39mnqD2v9ls38x2+ADAzDt/Zp6gBsC/Ch8AxkgMwA==","dtype":"float64","shape":[5]}}},"id":"3f3962f3-6d30-4f69-be6c-540b721a2bbd","type":"ColumnDataSource"},{"attributes":{"height":311,"text":"\n    <p>\n      <b>Linked Radial Chart</b>\n      <br>\n      by Tyler Nickerson \n    </p>\n    <p> \n      This visualization aims to recreate the look and functionality of \n      Elijah Meeks' \n      <a href='https://bl.ocks.org/susielu/b6bdb82045c2aa8225f5'>\n        Brushable Radial Plot (in D3)\n      </a>\n      ,  \n      <a href='http://bokeh.pydata.org/en/latest/'>\n        Bokeh\n      </a>. \n    </p>\n    <p>\n      This visualization reverses the relationship between the charts. \n      The cartesian chart supports panning and scroll-to-zoom interactions;\n      allowing the user to drill down into into the timeseries data. The range \n      of the cartesian chart updates the 'selection' window of the radial chart \n      making at glance comparisons between the radial and cartesian chart \n      easier. The color selection was adjusted slightly to make it easier \n      for people with red/green colorblindness discern between the different\n      fields.\n    </p>\n    <p>\n      Evenutally, I would like to add the flexibility to update the cartesian\n      chart range through interactions with the selection window. Support for\n      these kinds of interactions are not yet developed in Bokeh. However, it\n      may be possible by further extending the click-and-drag interactivity \n      using the Custom JavaScript feature.\n    </p>\n    <p>\n      <a href='http://github.com/nmbrgts/Linked-Radial-Chart' target='_blank'>Source</a>    \n      <a href='http://nmbrgts.github.io' taget='_blank'>Blog</a>    \n      <a href='mailto:tylerjnickerson@gmail.com' target='_blank'>Email</a> \n    </p>","width":525},"id":"238db2f2-7742-43b2-aca1-8462951bb747","type":"Div"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"a0428dfe-e033-4632-9001-ffc7f998208c","type":"AdaptiveTicker"},{"attributes":{},"id":"613254a9-9f52-4381-bda6-a59c717913c6","type":"ToolEvents"},{"attributes":{"end_angle":{"field":"end_angle","units":"rad"},"fill_alpha":{"value":0.7},"fill_color":{"value":"#c5edc5"},"inner_radius":{"field":"inner_radius","units":"data"},"line_alpha":{"value":0.7},"line_color":{"value":null},"outer_radius":{"field":"outer_radius","units":"data"},"start_angle":{"field":"start_angle","units":"rad"},"x":{"value":0},"y":{"value":0}},"id":"2807822b-8400-407f-93ef-a488ba877789","type":"AnnularWedge"},{"attributes":{"children":[{"id":"f8ca7881-48ac-41b4-bf59-5aa634a56e09","subtype":"Figure","type":"Plot"},{"id":"8df0f4e9-70e8-4f0c-955b-3b6c0b26b414","type":"Column"}]},"id":"54c2a118-ed64-4f10-9789-90d6decdf3e5","type":"Row"},{"attributes":{"formatter":{"id":"992280fd-f202-4b31-960d-7e83ae2ed985","type":"BasicTickFormatter"},"plot":{"id":"5ec3d35e-674b-430d-a3c8-f430eadde2d6","subtype":"Figure","type":"Plot"},"ticker":{"id":"3340dfb0-beb1-409f-a11e-47a9c9df2553","type":"BasicTicker"}},"id":"3046d47d-faa0-407a-90ea-2a700c7489a8","type":"LinearAxis"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.7},"fill_color":{"value":"#c5edc5"},"left":{"field":"left"},"line_color":{"value":null},"right":{"field":"right"},"top":{"field":"top"}},"id":"72d01fd5-f11f-4b49-bba1-f451f4c5471c","type":"Quad"},{"attributes":{"text_align":"center","text_alpha":{"value":0.1},"text_color":{"value":"black"},"x":{"field":"x"},"y":{"field":"y"}},"id":"5bdad902-0887-40a9-87d8-d32f310fe29f","type":"Text"}],"root_ids":["54c2a118-ed64-4f10-9789-90d6decdf3e5"]},"title":"Bokeh Application","version":"0.12.4"}};
